import { Card, CardMedia,Box, Typography } from "@material-ui/core";
import React from "react";

import meetupimg from "../../constants/cardimg.jpg";

const UserMeetupCard = ({name,address,description}) => {
  return (
    <Card sx={{ dispaly: "flex" }}>
      <CardMedia
        component="img"
        sx={{ width: 151, height:151 }}
        image={meetupimg}
        alt="meetup image"
      />
      <Box sx={{ dispaly: "flex", flexDirection: "column" }}>
        <Typography>{name}</Typography>
        <Typography>its a good world</Typography>
      </Box>
    </Card>
  );
};

export default UserMeetupCard;
